import React from 'react'


class User extends React.Component {
    constructor() {
        super()
        this.state = {
            loggedInUser: 1,
            users: [],
            username:false
        }
    }

    async componentDidMount(){
        try{
            let url = "http://localhost:3000/users"
            let res = await axios.get(url)
            this.setState({
                users: res.body.data
            })

        }catch(error){
            console.log(error)
        }
    }
    render() {
        return (
            <div>

            </div>
        )
    }
}

export default User;
